const theme = {
  colors: {
    link: "#561eff",
    dark: "rgb(105, 90, 245)",
    black: "rgb(68, 68, 68)",
    gray: "rgb(216, 213, 247)",
    green: "#1eff8f",
    pink: "#FF99CC",
    "pink-l": "#fab6d8",
    "pink-link": "rgba(255, 153, 204, 0.5)"
  }
};

export default theme;
